import React, { useState, useEffect } from 'react';
import { fetchCars, addToCart, fetchCart, fetchTotalPrice } from './api';  // Імпортуємо функції API
import './catalog.css';

const Catalog = () => {
  const [cars, setCars] = useState([]);
  const [sortedCars, setSortedCars] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');
  const [totalSpeed, setTotalSpeed] = useState(0);  // Загальна швидкість
  const [cart, setCart] = useState([]);

  useEffect(() => {
    const loadCars = async () => {
      const data = await fetchCars(searchTerm);  // Завантажуємо автомобілі з пошуковим терміном
      setCars(data);
      setSortedCars(data);  // Ініціалізуємо відсортовані дані
    };

    loadCars();
  }, [searchTerm]);

  useEffect(() => {
    const loadCart = async () => {
      const cartData = await fetchCart();  // Отримуємо кошик
      setCart(cartData);
    };

    loadCart();
  }, [cart]);

  // Функція для сортування автомобілів
  const sortCars = (order) => {
    const sorted = [...cars];
    sorted.sort((a, b) => {
      if (order === 'asc') {
        return a.maxSpeed - b.maxSpeed;  // Сортування за зростанням
      } else {
        return b.maxSpeed - a.maxSpeed;  // Сортування за спаданням
      }
    });
    setSortedCars(sorted);
  };

  // Підрахунок загальної швидкості
  const calculateTotalSpeed = async () => {
    const total = await fetchTotalPrice();
    setTotalSpeed(total.totalPrice);
  };

  // Фільтрація автомобілів по пошуковому терміну
  const handleSearchChange = (e) => {
    setSearchTerm(e.target.value);
  };

  // Функція для додавання до кошика
  const handleAddToCart = async (carId, quantity) => {
    const updatedCart = await addToCart(carId, quantity);
    setCart(updatedCart);  // Оновлення кошика
  };

  return (
    <div className="container">
      <h2>Каталог автомобілів</h2>

      {/* Панель пошуку */}
      <div className="search-bar">
        <input
          type="text"
          placeholder="Пошук..."
          value={searchTerm}
          onChange={handleSearchChange}
        />
      </div>

      {/* Кнопки сортування */}
      <div className="controls">
        <button onClick={() => sortCars('asc')}>Сортувати за зростанням</button>
        <button onClick={() => sortCars('desc')}>Сортувати за спаданням</button>
      </div>

      {/* Підрахунок загальної швидкості */}
      <div id="total-speed-container">
        <h3>Загальна швидкість всіх автомобілів: {totalSpeed} км/год</h3>
      </div>

      {/* Кнопка для підрахунку загальної швидкості */}
      <button className="count-total-speed" onClick={calculateTotalSpeed}>
        Підрахувати загальну швидкість
      </button>

      {/* Відображення автомобілів */}
      <div className="catalog-grid">
        {sortedCars.length > 0 ? (
          sortedCars.map((car) => (
            <div key={car.id} className="car-card">
              <h3>{car.brand} {car.model}</h3>
              <p>Макс. швидкість: {car.maxSpeed} км/год</p>
              <img src={`http://localhost:5008${car.image}`} alt={car.model} />

              {/* Кнопка додавання до кошика */}
              <button 
                onClick={() => handleAddToCart(car.id, 1)}  // Додаємо одну кількість
                className="add-to-cart-button"
              >
                Додати до кошика
              </button>
            </div>
          ))
        ) : (
          <p>Нічого не знайдено</p>
        )}
      </div>

      {/* Виведення кошика */}
      <div className="cart-summary">
        <h3>Кошик:</h3>
        <ul>
          {cart.map((item, index) => (
            <li key={index}>{`Автомобіль ID: ${item.carId}, Кількість: ${item.quantity}`}</li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default Catalog;
